import { useEffect } from 'react'
import './App.css';


function App() {
  useEffect(() => {
    fetch('https://jsonplaceholder.typicode.com/posts')
    .then(res => res.json())
    .then((data) => {
      console.log(data)
    })

  }, [])

  return (
    <div>
      App
    </div>
  );
}

export default App
